import React, {useState} from 'react';
import './App.css';

function Practice() {
  const [todo, setTodo] = useState(["wake up", "eat"]);
  const [input, setInput] = useState('');

  const addTodo = (event) => {
    event.preventDefault();
    setTodo([...todo, input]);
  } 

  return (
    <div className="App">
      <h1>hello world</h1>
      <form>
        <input value={input} onChange={event => setInput(event.target.value)}></input>
        <button onClick={addTodo}>Closet</button>
      </form>

      <ul>
        {todo.map(todo => (
          <li>{todo}</li>
        ))}
      </ul>
    </div>
  )
}

export default Practice;
